import React from 'react';
import './Aboutme.css';
import Header from './Header'; // Assuming Header component is used

const AboutMe = () => {
  return (
    <div>
      {/* Use the Header component */}
      <Header />

      {/* About Me Section */}
      <section className="about-section">
        <div className="profile-image">
          <img
            src="https://cdn.goodgallery.com/aff0103d-b383-4d77-a4d3-549a4ba909b4/t/2560/2b7bx8v5/business-headshot-photographer-professional-headshots-3.jpg"
            alt="Profile"
          />
        </div>

        <div className="about-content">
          <h2>About <span>Ava Smith</span></h2>
          <h4>Frontend Developer</h4>
          <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Molestias eos quasi obcaecati rem, voluptas animi expedita esse quam placeat incidunt.</p>
        </div>
      </section>

      {/* Education Section */}
      <section className="section">
        <h2>Education</h2>
        <p>Bachelor's degree in Computer Science from the University of Tampa. Extensive coursework in programming, algorithms, and software development.</p>
      </section>

      {/* Experience Section */}
      <section className="section">
        <h2>Experience</h2>
        <p>Experience in building responsive websites and web applications. Internships include positions as a frontend developer at multiple firms.</p>
      </section>

      {/* Skills Section */}
      <section className="section">
        <h2>Skills</h2>
        <p>Proficient in HTML, CSS, JavaScript, React, and Java. Passionate about learning new technologies and solving complex coding challenges.</p>
      </section>
    </div>
  );
};

export default AboutMe;
